Hi,
Is fully compatible with OnePlus launcher stock, you have to apply the icons from the launcher settings menu;
Very simple, just hold down on an empty portion of a home and the button appears to go to the launcher settings;
Then in the settings, just find the voice related to the icons and you can apply my icon pack with a click;
Thanks.

